import React from "react";
import {Button} from 'antd';

const Employee = ({coordinate, id, removeItem}) => {

    const removeEmployee = () => {
        removeItem(id)
    }

    return <div>
        <div>
            <span>
                            <div>Latitude: {coordinate.latitude}</div>
                            <div>Longitude:{coordinate.longitude}</div>
                            <div>Longitude:{coordinate.date.toLocaleString("ru", options)}</div>
                            <div> DATE: {coordinate.date.getDate()}.{coordinate.date.getUTCMonth()}.{coordinate.date.getFullYear()} {coordinate.date.getHours()}:{coordinate.date.getMinutes()}:{coordinate.date.getSeconds()}</div>


                        </span>

        </div>

        <Button danger onClick={removeEmployee}>Delete</Button>

    </div>
}

export default Employee;
